import {HorizontalGridLines, LineSeries, XAxis, XYPlot, YAxis} from "react-vis";

export const Graph = () => {
    return (
        <XYPlot
            width={1000}
            height={300}>
            <HorizontalGridLines />
            <LineSeries
                data={[
                    {x: 1, y: 10},
                    {x: 2, y: 5},
                    {x: 3, y: 15}
                ]}/>
            <XAxis />
            <YAxis />
        </XYPlot>
    )
}
